// src/components/HomePage.js
import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-container">
      <div className="hero-section">
        <h1>Welcome to the AI Travel Planner</h1>
        <p>Your personalized guide to the best travel experiences in India.</p>
        <button className="cta-button">Start Planning</button>
      </div>
      <div className="features-section">
        <div className="feature-card">
          <h2>Discover New Places</h2>
          <p>Find recommendations for top tourist destinations across India.</p>
        </div>
        <div className="feature-card">
          <h2>Personalized Suggestions</h2>
          <p>Get customized travel plans based on your preferences and budget.</p>
        </div>
        <div className="feature-card">
          <h2>Easy Bookings</h2>
          <p>Book hotels, flights, and transportation in one place.</p>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
